measurements.description:
One flower on one 19.0-cm inflorescence;  
   dorsal sepal light cordovan centrally, flushed magenta, darker veins, white apex; 
   synsepal flushed and veined dark maroon;

   petals light cordovan, darker venation;
   pouch dark cordovan, darker venation;
staminode white flushed pink, boss light magenta;   

	substance good; texture waxy.
